import React, { Component } from 'react'
import styled from 'styled-components'

// Components
import FullScreen from '../fullscreen'

// Images
import background from './background.jpg'

const ProfileWrapper = styled(FullScreen)`
  background: linear-gradient(rgba(0, 0, 0, 0.7), rgba(0, 0, 0, 0.7)),
    url(${background});
  background-size: cover;
  color: white;
  width: 70%;
  display: inline-block;
  vertical-align: top;
`

const ProfileContainer = styled.div`
  width: intrinsic;
  padding: 30px 50px;
  position: relative;
`
const ProfileBorder = styled.div`
  &:before {
    content: '';
    position: absolute;
    width: 70%;
    height: 60%;
    bottom: 0;
    left: 0;
    border-bottom: 1px solid rgba(255, 255, 255, 0.6);
    border-left: 1px solid rgba(255, 255, 255, 0.6);
  }

  &:after {
    content: '';
    position: absolute;
    width: 70%;
    height: 60%;
    top: 0;
    right: 0;
    border-top: 1px solid rgba(255, 255, 255, 0.6);
    border-right: 1px solid rgba(255, 255, 255, 0.6);
  }
`

const ProfileTitle = styled.h1`
  color: white;
  font-family: 'Julius Sans One', sans-serif;
  font-size: 3.5rem;
  text-align: left;
  margin: 0 0 10px;
`

const ProfileDetail = styled.p`
  font-size: 0.9rem;
  letter-spacing: 3px;
  margin: 0;
  margin-left: 5px;
  opacity: 0.6;
`

const ProfileEducation = styled.p`
  font-size: 0.8rem;
  margin: 15px 15px 0 5px;
  opacity: 0.6;
  display: inline-block;

  &:before {
    font-family: 'Font Awesome 5 Free';
    content: '\f19d';
    margin-right: 7px;
  }
`

class Info extends Component {
  render() {
    return (
      <ProfileWrapper>
        <ProfileContainer>
          <ProfileBorder />
          <ProfileTitle>Punn</ProfileTitle>
          <ProfileDetail>Punchaya Siriphanthong</ProfileDetail>
          <ProfileDetail>26 December 1996 | 22 years old</ProfileDetail>
          <ProfileDetail>p.siriphanthong@gmail.com</ProfileDetail>
          <ProfileEducation>CPE29 @ KMUTT</ProfileEducation>
          <ProfileEducation>ACU #4932</ProfileEducation>
        </ProfileContainer>
      </ProfileWrapper>
    )
  }
}

export default Info
